class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function minimumDeviation($nums) {

        $pq = new SplPriorityQueue();

        $len = count($nums);
        for ($i=0; $i<$len; $i++) {
            if ($nums[$i]%2!=0) {
                $pq->insert($nums[$i] * 2, $nums[$i] * 2);
                $nums[$i] *= 2;
            } else {
                $pq->insert($nums[$i], $nums[$i]);
            }
        }

        //print_r($pq);

        $max = $pq->top();
        $min = min($nums);
        $deviation_min = PHP_INT_MAX;
        //$cnt = 0;
        //echo "$min $max\n";

        while ($max%2==0) { // and $cnt++<5000
            $pq->extract();
            $pq->insert($max/2, $max/2);

            $min = min($min, $max/2);
            $max = $pq->top();
            $deviation = $max - $min;

            //echo "$min $max $deviation\n";
            
            $deviation_min = min($deviation, $deviation_min);
        }

        return $deviation_min;
    }


}

